import React from 'react';
import Tile from "./Tile";

const SectionWithTiles = () => {
    return (
        <div className="inside_content">
            <Tile tile={{id: 1}}/>
            <Tile tile={{id: 2}}/>
            <Tile tile={{id: 3}}/>
        </div>
    );
};

export default SectionWithTiles;
